import {ContextConsumer} from '../context/Context'

class Details extends Component{

    render(){
        return(
            <ContextConsumer>
                {(data)=>{
                    let temp=data.devices.filter((item)=>{
                        console.log()
                        return item.id==this.props.match.params.userId;
                         })
                         console.log(temp)
                    return(

                            <h1>{temp.name}</h1>
                    )
                }

                }
            </ContextConsumer>

        );
    }
}

export default Details;
